import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import './App.css';
import Home from './Pages/Home';
import BlogPage from './Pages/BlogPage';


const router = createBrowserRouter([
  {
    path:"/",
    element : <Home />
  },
  {
    path:"/blog",
    element : <BlogPage />
  },
  {
    path:"/login",
    element : <BlogPage />
  },

])


function App() {
  return (
    <RouterProvider router={router} />
  );
}

export default App;
